import { Link } from 'react-router-dom';
import "./Owner.css";

export default function Ownernav(props){

    let pages = props.pages;

    return(
        <>
            <div className="container-fluid" style={{padding:"0"}}>
                <div className="row" style={{margin:"0"}}>
                
                {/* position-relative */}
                        <div className="sidebar text-center ">
                            <div className="sidebar-img">
                                <img src={`http://localhost:8080/images/Logo.jpg`} alt="" style={{width:"225px"}}/>
                            </div>

                            <div>

                            </div>


 
                            

                            <div className="p-3 mt-5 exit position-absolute bottom-0 end-0 start-0 "> 
                                <Link to ="/" className="text1">ออกจากระบบ</Link>
                            </div>
                        </div>
                </div>
            </div>
        </>
    )
}
